import React, { Component } from "react";
import axios from "axios";

class Profile extends Component {
  constructor(props) {
    super(props);
    this.state = {
      userData: null,
      error: null,
    };
  }

  componentDidMount() {
    this.fetchData();
  }

  fetchData = () => {
    axios
      .get("http://195.210.47.82:8000/auth/me/")
      .then((response) => {
        this.setState({ userData: response.data });
        console.log("Полученные данные:", response.data);
        // Здесь можно добавить дополнительную обработку полученных данных
      })
      .catch((error) => {
        if (error.response) {
          this.setState({ error: error.response.data });
          console.error("Ошибка при получении данных:", error.response.data);
          // Обработка ошибок с сервера (например, вывод error.response.data)
        } else {
          this.setState({ error: error.message });
          console.error("Ошибка при получении данных:", error.message);
          // Обработка других ошибок (например, сетевые ошибки)
        }
      });
  };

  render() {
    const { userData, error } = this.state;

    return (
      <div>
        {error ? (
          <p>
            Произошла ошибка:{" "}
            {typeof error === "object" ? JSON.stringify(error) : error}
          </p>
        ) : (
          <p>
            Полученные данные:{" "}
            {userData ? JSON.stringify(userData) : "Загрузка..."}
          </p>
        )}
      </div>
    );
  }
}

export default Profile;
